import React from "react";

const Banner = () => {

    return (
        <div className="banner"> 
            <h2>114 LAT DOŚWIADCZENIA</h2>
            <p>Od 1907 Praga projektuje, rozwija i produkuje samochody wyścigowe, drogowe, samoloty, ciężarówki, autobusy, motocykle i gokarty na cały świat.</p>
            <button>Dowiedz się więcej o historii Pragi tutaj.</button>
        </div>
    )

}

export default Banner;
